import styled from "styled-components";

const StyledButton = styled.button`
  width: 320px;
  height: 90px;

  border-radius: 5px;
  background: #00a9ce;

  font-size: 32px;
  font-family: "Roboto", sans-serif;
  font-weight: bold;


`;

const Button = ({ children }) => {
  return <StyledButton>{children}</StyledButton>;
};

export default Button;
